console.log(classes as any);

const button: FC<Props> = props => {
    let buttonTypeClass:string;
    switch (props.type) {
        case ButtonType.Success:
            buttonTypeClass = Success;
            break;
        case ButtonType.Danger:
            buttonTypeClass = Danger;
            break;
    }
    console.log(buttonTypeClass);
    return <button className={[classes.Button, (classes as any)[buttonTypeClass]].join(' ')}
        onClick={props.clicked} disabled={props.disabled}>
        {props.children}
    </button>
};

export default button;
